unsigned int sombrero_bmp_int_len = 74880;

// Mask values:
// 0: No grayscaling
// 1: RGB grayscaling with down sampling
// 2: RGB grayscaling (no "data loss")

void gray_scaling(pixel_stream &src, pixel_stream &dst, uint32_t mask, uint32_t x_start, uint32_t y_start)
{
#pragma HLS INTERFACE ap_ctrl_none port = return
#pragma HLS INTERFACE axis port = src
#pragma HLS INTERFACE axis port = dst
#pragma HLS INTERFACE s_axilite port = mask
#pragma HLS INTERFACE s_axilite port = x_start
#pragma HLS INTERFACE s_axilite port = y_start
#pragma HLS PIPELINE II = 1

    // Data to be stored across 'function calls'
    static uint16_t x = 0;
    static uint16_t y = 0;
    static uint16_t frame = 0;

    pixel_data p;

    // Load pixel data from source
    src >> p;

    if (p.user)
    {
        x = 0;
        y = 0;
        frame = (frame + 1) % 360;
    }
    int x_offset = x - x_start;
    int y_offset = y - y_start;

    ////////////////////////////////////////
    // NORMAL MODE - SOMBRERO
    if (mask == 0)
    {

        if (x_offset >= 0 && y_offset >= 0)
        {
            if (x_offset < BMP_WIDTH && x_offset + y_offset * BMP_WIDTH <= sombrero_bmp_int_len)
            {
                if (sombrero_data[x_offset + y_offset * BMP_WIDTH] != 0)
                {
                    p.data = sombrero_data[x_offset + y_offset * BMP_WIDTH];
                    p.data = ~(p.data & 0x00FFFFFF) | (p.data & 0xFF000000); // invert only the RGB channels
                }
            }
        }
        dst << p;
    }
    // PARTYYY MODDEEE
    if ((mask & 1) > 0)
    {
        // Compute rotation angle based on frame
        float angle = (frame * (M_PI / 180.0)); // Convert to radians
        float cos_a = cos(angle);
        float sin_a = sin(angle);

        int x_rot = cos_a * x_offset - sin_a * y_offset;
        int y_rot = sin_a * x_offset + cos_a * y_offset;

        int x_mapped = x_rot + (BMP_WIDTH / 2);
        int y_mapped = y_rot + (BMP_WIDTH / 2);

        int index = x_mapped + y_mapped * BMP_WIDTH;

        if (x_mapped >= 0 && y_mapped >= 0 && x_mapped < BMP_WIDTH &&
            index < sombrero_bmp_int_len)
        {
            if (sombrero_data[index] != 0)
            {
                p.data = sombrero_data[index];
                p.data = ~((p.data & 0x00FF0000) |
                           ((p.data & 0x0000FF00) >> 8) |
                           ((p.data & 0x000000FF) << 8)) |
                         (p.data & 0xFF000000);

                const float tint_factor = 0.3f;
                int hue_channel = frame % 3;

                uint8_t a = (p.data >> 24) & 0xFF;
                uint8_t r = (p.data >> 16) & 0xFF;
                uint8_t g = (p.data >> 8) & 0xFF;
                uint8_t b = p.data & 0xFF;

                float new_r, new_g, new_b;
                if (hue_channel == 0) // Red
                {
                    new_r = (1.0f - tint_factor) * r + tint_factor * 255.0f;
                    new_g = (1.0f - tint_factor) * g;
                    new_b = (1.0f - tint_factor) * b;
                }
                else if (hue_channel == 1) // Blue
                {
                    new_r = (1.0f - tint_factor) * r;
                    new_g = (1.0f - tint_factor) * g;
                    new_b = (1.0f - tint_factor) * b + tint_factor * 255.0f;
                }
                else if (hue_channel == 2) // Green
                {
                    new_r = (1.0f - tint_factor) * r;
                    new_g = (1.0f - tint_factor) * g + tint_factor * 255.0f;
                    new_b = (1.0f - tint_factor) * b;
                }

                uint8_t final_r = static_cast<uint8_t>(std::min(255.0f, new_r));
                uint8_t final_g = static_cast<uint8_t>(std::min(255.0f, new_g));
                uint8_t final_b = static_cast<uint8_t>(std::min(255.0f, new_b));

                p.data = (a << 24) | (final_r << 16) | (final_g << 8) | final_b;
            }
        }

        dst << p;
    }

    // Increment X and Y counters
    if (p.last)
    {
        x = 0;
        y++;
    }
    else
    {
        x++;
    }
}

void stream(pixel_stream &src, pixel_stream &dst, int frame)
{
    gray_scaling(src, dst, 1, 250, 250);
}
